(window.webpackJsonp=window.webpackJsonp||[]).push([[232],{585:function(n,h,t){"use strict";t.r(h);var i=t(44),g=Object(i.a)({},(function(){var n=this,h=n.$createElement,t=n._self._c||h;return t("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[t("h1",{attrs:{id:"chuong-1186-that-tinh-danh-su"}},[t("a",{staticClass:"header-anchor",attrs:{href:"#chuong-1186-that-tinh-danh-su"}},[n._v("#")]),n._v(" Chương 1186: Thất tinh danh sư!")]),n._v(" "),t("hr"),n._v(" "),t("p",[n._v("Chương 1186: Thất tinh danh sư!"),t("br"),t("br"),n._v("Nhìn thấy hắn bộ dáng này, Cẩu đường chủ lần nữa hộc máu, buồn bực sắp điên rồi."),t("br"),t("br"),n._v("Lần này khẳng định là không có cách nào an ổn về hưu... Nhiều như vậy Tiên Tổ ý niệm đều bị cả không còn, đường chủ làm được hắn mức này, cũng coi như từ trước tới nay người thứ nhất!"),t("br"),t("br"),n._v("“Trương sư xông đường thành công, có thể đưa ra bất kỳ yêu cầu gì, chỉ cần không vi phạm danh sư đạo nghĩa, chúng ta Thanh Nguyên đế quốc Danh Sư đường, bằng lòng như Thiên Lôi sai đâu đánh đó, cúi đầu nhận lệnh!”"),t("br"),t("br"),n._v("Nhẫn nhịn không biết bao lâu, Cẩu đường chủ lúc này mới nhịn được ngực buồn bực, ôm quyền khom người, thái độ lại không có ngạo mạn lúc trước."),t("br"),t("br"),n._v("Từ trước tới nay, chỉ có ba vị xông đường thành công, không nghĩ tới để hắn đuổi kịp một cái..."),t("br"),t("br"),n._v("“Điền Thanh phó đường chủ liên hợp Trung Thanh Vương, mưu hại danh sư! Càng cố ý rò rỉ danh sư cơ mật, dẫn đến Dị Linh tộc nhân đột kích, hại chết vô số danh sư... Tội ác tày trời, tội không được thứ cho, ta hi vọng Thanh Nguyên đế quốc Danh Sư đường có thể lập tức tra rõ!”"),t("br"),t("br"),n._v("Trương Huyền nói."),t("br"),t("br"),n._v("“Vâng...”"),t("br"),t("br"),n._v("Cẩu đường chủ gật đầu, đang nghĩ nói chuyện, đột nhiên nhướng mày: “Điền Thanh phó đường chủ đâu?”"),t("br"),t("br"),n._v("Vừa rồi vị này Điền phó đường chủ còn cùng hắn một tấc cũng không rời, làm sao thời gian nháy mắt đã không thấy tăm hơi?"),t("br"),t("br"),n._v("“Bẩm báo đường chủ, phó đường chủ mới vừa có chuyện xảy ra rời đi một chuyến...”"),t("br"),t("br"),n._v("Một vị danh sư liền vội vàng tiến lên."),t("br"),t("br"),n._v("“Nguy rồi!”"),t("br"),t("br"),n._v("Con ngươi co rụt lại, Cẩu đường chủ vội vàng phân phó: “Lập tức cho ta tìm...”"),t("br"),t("br"),n._v("Soạt!"),t("br"),t("br"),n._v("Rất nhiều danh sư lập tức liền xông ra ngoài, thời gian không dài tất cả đều bay trở về, nguyên một đám vẻ mặt khó coi: “Đường chủ... Điền sư đã rời khỏi Đế đô, không biết đi nơi nào...”"),t("br"),t("br"),n._v("Thân thể run lên, Cẩu đường chủ sắc mặt tái xanh."),t("br"),t("br"),n._v("Vừa rồi Trương sư xông danh sư tháp, quá mức khiếp sợ, không có chú ý cái tên này, nằm mơ đều không có nghĩ đến, thừa cơ chạy trốn!"),t("br"),t("br"),n._v("Nhìn tới, hắn nhìn ra Trương sư xông đường sắp thành công, bất cứ lúc nào cũng sẽ bị bắt, không dám tiếp tục dừng lại."),t("br"),t("br"),n._v("“Ta xông đường mục đích đúng là bởi vì bị đối phương oan uổng, biết rất rõ ràng một khi thành công, hắn khẳng định sẽ trốn, lại không trước thời hạn làm ra chuẩn bị... Ngươi vị đường chủ này, làm lấy còn có cái gì ý nghĩa?”"),t("br"),t("br"),n._v("Trương Huyền vẻ mặt khó coi."),t("br"),t("br"),n._v("Bản thân cùng Danh Sư đường mâu thuẫn nằm ở chỗ cái này Điền Thanh trên đầu, mặc kệ có thể hay không xông đường thành công, đối phương cũng khó khăn từ tội lỗi, loại tình huống này, không phái người chặt chẽ coi chừng, tùy ý đối phương tới lui tự nhiên, không trốn đi làm sao có thể?"),t("br"),t("br"),n._v("Thất tinh đỉnh phong cấp bậc danh sư, thật muốn ẩn tàng lời nói, trừ phi dùng Minh Lý Chi Nhãn, lần lượt tìm kiếm, nếu không, căn bản là tìm không đến."),t("br"),t("br"),n._v("“Ta...”"),t("br"),t("br"),n._v("Cẩu đường chủ vẻ mặt đỏ lên."),t("br"),t("br"),n._v("Thật không nghĩ tới trước mắt vị này có thể xông đường thành công, hơn nữa nhanh như vậy... Tự nhiên cũng liền không có kịp phản ứng."),t("br"),t("br"),n._v("“Bên dưới Thanh Nguyên đế quốc Danh Sư đường danh sư lệnh truy nã! Bắt Điền Thanh, dám bắt, có thể tại chỗ đánh chết!”"),t("br"),t("br"),n._v("Nắm đấm xiết chặt, Cẩu đường chủ quay đầu phân phó."),t("br"),t("br"),n._v("“Rõ!”"),t("br"),t("br"),n._v("Một vị danh sư xoay người rời khỏi."),t("br"),t("br"),n._v("Danh sư lệnh truy nã, là toàn bộ đại lục cấp bậc cao nhất bắt lệnh, một khi phát ra, toàn bộ Thanh Nguyên đế quốc phạm vi bên trong tất cả đế quốc, vương quốc Danh Sư đường, đều sẽ nhận được tin tức, phạm vi bên trong tu luyện giả bất kể là ai, chỉ cần phát hiện, tố cáo liền có thể nhận được ngợi khen."),t("br"),t("br"),n._v("Có thể nói, cái này lệnh truy nã phía dưới, trừ phi một mực thay đổi thân phận, không bại lộ thực lực, nếu không, tất nhiên khó mà chạy trốn."),t("br"),t("br"),n._v("“Ta Cẩu Thiên Trạch, xử sự bất công, phụ lòng Danh Sư đường tín nhiệm, từ hôm nay trở đi, từ đi Danh Sư đường đường chủ chức vụ, chờ tổng bộ phái người đến đây xử lý. Còn đường chủ vị trí, tạm thời do Ngô sư thay thế!”"),t("br"),t("br"),n._v("An bài xong, Cẩu đường chủ đem trên thân đại biểu thân phận lệnh bài lấy ra, đưa tới."),t("br"),t("br"),n._v("Trong nháy mắt, giống như là già mấy trăm tuổi, lại không có nửa điểm sức lực."),t("br"),t("br"),n._v("Tại đường chủ vị trí, đợi trọn năm trăm năm, tận tâm tận lực, nằm mơ đều không có nghĩ đến sẽ lấy loại phương thức này kết thúc."),t("br"),t("br"),n._v("Biết đối phương đã chạy trốn, muốn bắt lấy không dễ dàng như vậy, Trương Huyền lắc đầu, không còn xoắn xuýt, ngẩng đầu nhìn về phía Ngô sư."),t("br"),t("br"),n._v("“Ngô sư, đây là ta phụ tu chức nghiệp, đã đầy đủ, muốn xin thất tinh danh sư!”"),t("br"),t("br"),n._v("Nói hết, đem lấy được thất tinh phụ tu chức nghiệp huy chương đưa tới."),t("br"),t("br"),n._v("Nhìn một cái, Ngô sư nhẹ gật đầu: “Trương sư chờ, ta sẽ đưa ngươi tình huống, báo lên tổng bộ, khả năng cần tiêu tốn một chút thời gian!”"),t("br"),t("br"),n._v("“Không vội vã, vừa vặn không có việc gì, ta đi Tàng Thư khố nhìn một chút!”"),t("br"),t("br"),n._v("Trương Huyền lên tiếng."),t("br"),t("br"),n._v("Mặc dù hắn có tấn thăng đế quốc kinh nghiệm, nhưng muốn xin thất tinh huy chương, khẳng định vẫn là cần quá trình muốn đi, có Ngô sư chủ trì, nên vấn đề không lớn, cũng không cần thiết lo nghĩ, cùng hắn phiền phức chờ lấy, còn không bằng thừa cơ đi xem một chút thư."),t("br"),t("br"),n._v("Mặc dù đã nắm giữ thất tinh danh sư tư cách, nhưng liên quan tới thất tinh danh sư sách, còn chưa hề nhìn qua."),t("br"),t("br"),n._v("“Đây là thân phận lệnh bài của ta, Trương sư cầm trong tay cái này, Tàng Thư khố tùy ý quan sát...”"),t("br"),t("br"),n._v("Ngô sư nói."),t("br"),t("br"),n._v("Xông đường thành công, cả tòa Danh Sư đường tất cả danh sư cũng không là đối thủ, nhận được huy chương là chuyện ván đã đóng thuyền, không thể nghi ngờ, bởi vậy, trước thời hạn tướng lệnh bài cho hắn, để hắn vào xem thư, cũng không tính không tuân theo quy định."),t("br"),t("br"),n._v("“Ừm!”"),t("br"),t("br"),n._v("Nhận lấy lệnh bài, Trương Huyền không nói thêm lời, tại một vị danh sư dẫn đầu bên dưới, hướng Tàng Thư khố đi đến."),t("br"),t("br"),n._v("Thanh Nguyên đế quốc Danh Sư đường Tàng Thư khố, không chỉ có danh sư liên quan tất cả sách, còn có rất nhiều phụ tu chức nghiệp, trước đó nhìn thư họa sư, giám bảo sư các loại sách, thình lình xuất hiện."),t("br"),n._v("Danh sư, chú ý liền là bác học, sách số lượng nhiều, không biết bao nhiêu, nhìn trọn một ngày, mới đem thu sạch quay đi vào trong óc."),t("br"),t("br"),n._v("Xem hết danh sư loại, đi tới phụ tu sách tra cứu kho, trong đó sưu tập khải linh sư, ma âm sư, luyện đan sư, y sư, thư họa sư, thuần thú sư, kinh hồng sư, trận pháp sư, giám bảo sư, thiên công sư các loại là nhiều loại chức nghiệp loại sách, cũng cùng nhau thu vào trong óc."),t("br"),t("br"),n._v("Danh Sư đường phụ tu chức nghiệp loại sách, mặc dù không có mỗi người công hội kỹ càng, cao xa, nhưng đối Trương Huyền tới nói, chỉ cần số lượng đầy đủ là được, cao xa không cao thâm, không quan trọng."),t("br"),t("br"),n._v("Đem những nghề nghiệp này sách, thất tinh cấp bậc Thiên Đạo công pháp, toàn bộ học được, đã là từ Chiến sư đường đi ra, ba ngày sau đó."),t("br"),t("br"),n._v("“Trương sư, đây là đẳng cấp của ngươi huy chương...”"),t("br"),t("br"),n._v("Vừa đi ra Tàng Thư khố, Ngô sư liền tiến lên đón."),t("br"),t("br"),n._v("Nhìn một cái, Trương Huyền thở phào nhẹ nhõm."),t("br"),t("br"),n._v("Từ giờ trở đi, rốt cục thất tinh danh sư."),t("br"),t("br"),n._v("Một năm trước, hắn liền danh sư cái nghề nghiệp này đều không có nghe nói qua, chỉ là Thiên Huyền vương quốc một tên sắp bị khai trừ lão sư, mà bây giờ đã đạt tới thất tinh, thành đại lục đỉnh phong trong đám người một thành viên, suy nghĩ một chút đều làm người thổn thức."),t("br"),t("br"),n._v("“Trương sư, Điền Thanh bây giờ còn chưa có tung tích, chẳng qua ngươi yên tâm, ta đã đem chuyện này kỹ càng báo cáo đến tổng bộ, tổng bộ cũng đã phái người xuống, không có gì bất ngờ xảy ra, trong nửa tháng liền có thể đến!”"),t("br"),t("br"),n._v("Ngô sư nói tiếp."),t("br"),t("br"),n._v("“Ừm!” Trương Huyền gật đầu."),t("br"),t("br"),n._v("Điền Thanh thấy mình xông đường thành công, tất nhiên đã chạy trốn, trừ phi danh sư tổng bộ người tới, mượn nhờ đặc thù pháp bảo, nếu không, muốn tìm được, gần như không có khả năng làm được."),t("br"),t("br"),n._v("“Trung Thanh Vương đâu? Có hay không bắt trở lại?”"),t("br"),t("br"),n._v("“Hắn bị giam giữ tại Danh Sư đường nội bộ, có điều, không nói gì.” Ngô sư nói."),t("br"),t("br"),n._v("“Trước giam giữ, trước đó ta cho ngươi khen ngợi Trần Triết, thế nào?”"),t("br"),t("br"),n._v("Trần Triết sau khi chết, Trương Huyền để Ngô sư đối với hắn tiến hành khen ngợi, mà không phải phê bình, còn chưa bắt đầu, liền bắt đầu xông đường, hiện tại Ngô sư lần nữa quản lý đại quyền, cũng đã hoàn thành đi!"),t("br"),t("br"),n._v("“Dựa theo ngươi phân phó như thế, sáng hôm nay mới vừa mở xong khen ngợi đại hội, nói hắn vì nhân tộc làm cống hiến to lớn, cung cấp rất kỹ càng tư liệu...” Ngô sư liền vội vàng gật đầu."),t("br"),t("br"),n._v("“Vậy là tốt rồi, hiện tại mang mấy cái thực lực mạnh mẽ danh sư, cùng ta cùng một chỗ, có thể trực tiếp đi bắt Điền Thanh phó đường chủ!”"),t("br"),t("br"),n._v("Nghe hắn đã an bài xong, Trương Huyền cười cười nói."),t("br"),t("br"),n._v("“Trực tiếp đi bắt? Đi nơi nào?”"),t("br"),t("br"),n._v("Ngô sư sững sờ."),t("br"),t("br"),n._v("“Rất đơn giản, đi Trần Triết trong nhà mai phục, không có gì bất ngờ xảy ra, buổi tối hôm nay, tất nhiên có người đến thăm!” Trương Huyền gật đầu."),t("br"),t("br"),n._v("“Đêm nay đến thăm? Trương sư ý tứ, vị này Trần Triết nắm giữ Điền Thanh bí mật gì?” Lông mày nhíu một cái, Ngô sư rất nhanh hiểu được."),t("br"),t("br"),n._v("Trần Triết là Điền Thanh học sinh, đang tại thẩm tra quá trình bên trong, vô duyên vô cớ chết tại lồng giam, hiện tại Điền Thanh lại chạy trốn... Muốn nói cả hai không quan hệ, hắn đều không tin."),t("br"),t("br"),n._v("“Ta cũng không biết, chỉ là hai ngày này đọc sách, đột nhiên sinh ra một cái phỏng đoán, vị này Trần Triết, nếu không phải nắm giữ bí mật, không có khả năng bị giết người diệt khẩu! Hiện tại ngươi làm chúng khen ngợi, cứ việc đối phương sẽ sinh ra hoài nghi, có thể... Hắn cũng không dám cược!”"),t("br"),t("br"),n._v("Trương Huyền cười nói."),t("br"),t("br"),n._v("“Ta biết, hắn có khả năng nắm giữ bí mật gì, nhưng... Điền Thanh hiện tại đã là chuột chạy qua đường, một khi bị bắt, thấp nhất đều sẽ bị tước đoạt danh sư thân phận, đều đã như vậy, không cần thiết lại vì một chút cái gọi là bí mật mạo hiểm đi!”"),t("br"),t("br"),n._v("Ngô sư không hiểu."),t("br"),t("br"),n._v("Hiện tại Điền Thanh, cùng phạm vào tội chết tội phạm đồng dạng, dù sao đều là nặng nhất trừng phạt, chắc chắn sẽ không lại để ý nhiều hơn mấy cái tội... Đã như vậy, cho dù Trần Triết nơi đó có thứ gì bí mật, cũng không trở thành, làm cho đối phương bốc lên bị bắt nguy hiểm, lặng lẽ tới?"),t("br"),t("br"),n._v("“Vậy phải xem Trần Triết đến cùng nắm giữ bao nhiêu bí mật!”"),t("br"),t("br"),n._v("Trương Huyền nói: “Trần Triết sở dĩ bại lộ, là bởi vì đi Chương Dẫn Khâu nơi đó lấy đi tin tức, kết quả, Danh Sư đường không biết, Dị Linh tộc nhân biết... Nếu như, hắn biết đến tin tức, quan hệ cái này Dị Linh tộc nhân, hoặc là đặc thù lối đi bí mật đâu?”"),t("br"),t("br"),n._v("“Cái này...”"),t("br"),t("br"),n._v("Ngô sư thân thể cứng đờ, tràn đầy khó tin: “Trương sư, có phải hay không phát hiện cái gì?”"),t("br"),t("br"),n._v("“Hiện nay chỉ là suy đoán, còn khó xác định!”"),t("br"),t("br"),n._v("Trương Huyền lắc đầu."),t("br"),t("br"),n._v("Hai ngày này, hắn không riêng gì đọc sách học tập, thuận tiện cũng tương lai Thanh Nguyên thành cái này sáu, bảy ngày gặp gỡ cẩn thận cân nhắc một lần."),t("br"),t("br"),n._v("Đẩy mấy lần, quả nhiên phát hiện không đúng."),t("br"),t("br"),n._v("Dị Linh tộc nhân, từ Trần Triết nơi này biết tin tức, muốn nói Điền Thanh không biết, là tuyệt không có khả năng."),t("br"),t("br"),n._v("Thân là Danh Sư đường phó đường chủ, tin tức rò rỉ cho Dị Linh tộc nhân... Lại không truy cứu, bản thân liền rất kỳ quái."),t("br"),t("br"),n._v("“Tốt, ta hiện tại liền đi triệu tập...”"),t("br"),t("br"),n._v("Biết Trương sư nói như vậy, khẳng định là biết thứ gì, Ngô sư vội vã rời khỏi, thời gian không dài, mang theo năm vị danh sư tới."),t("br"),t("br"),n._v("Bốn vị đều là Danh Sư đường trưởng lão, một vị khác người quen biết cũ, Trương Cửu Tiêu!"),t("br"),t("br"),n._v("Trương Cửu Tiêu mặc dù tại Trương Huyền trước mặt, không đỡ nổi một đòn, bị đánh tìm không thấy đông nam tây bắc, nhưng thực lực chân chính, còn là không thể khinh thường, lại thêm trên người rất nhiều pháp bảo vũ khí, nếu là không chú ý quy tắc, chỉ sợ Ngô sư cũng chưa chắc có thể là đối thủ."),t("br"),t("br"),n._v("“Trước đừng có gấp, trời tối chúng ta lại xuất phát!”"),t("br"),t("br"),n._v("Trương Huyền cười cười."),t("br"),t("br"),n._v("“Tốt!”"),t("br"),t("br"),n._v("Mọi người đồng thời gật đầu."),t("br"),t("br"),n._v("Đi qua xông đường, tất cả mọi người đối trước mắt vị này, phục sát đất, hiện tại Trương Huyền uy tín, tại Thanh Nguyên đế quốc Danh Sư đường, so với Ngô sư, cũng đã có chi mà không bằng."),t("br"),t("br"),t("br"),t("br")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("a",{attrs:{href:"./chap-1194"}},[n._v("Chương trước")]),n._v("  |  "),t("a",{attrs:{href:"./chap-1196"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=g.exports}}]);